import React from 'react';

import { 
    Container,
    MenuContainer,
    MenuItemLink
}  from './styles';

const Aside: React.FC = () => {
    return (
        <Container>
            <MenuContainer>
                <MenuItemLink href="#">
                    Dashboard
                </MenuItemLink>
            </MenuContainer>
        </Container>
    );
}

export default Aside;
